from math import isqrt
from sympy import isprime
def aupto(lim):
    s = [i**2 for i in range(1, isqrt(lim)+2)]
    t = set(int(str(a)+str(b)) for a in s for b in s)
    return sorted(filter(isprime, filter(lambda x: x<=lim, t)))
